  true,\n\t\"url\": null,\n\t\"notes\": \"The National Assessment of Educational Progress,
  2009 (NAEP 2009), is a study that is part of the National Assessment of Educational
  Progress (NAEP) program; program data is available since 1990 at http://nces.ed.gov/nationsreportcard/naepdata/.
  NAEP 2009 (http://nces.ed.gov/nationsreportcard/) is a cross-sectional survey that
  assesses what America's students know and can do in various subject areas. The study
  was conducted using computer-based assessment of students. Students in grades 4,
  8, and 12 were sampled. NAEP 2009 assessments consist of national and state assessments
  in reading and math, at grades 4 and 8; a national and state sample in writing at
  grade 8; and a national only writing sample at grade 12. The studyufffdufffds response
